import { combineReducers } from 'redux';
import setGoal from './goal';
import { addBook, deleteBook } from './books';
import login from './login';

export default combineReducers({
    setGoal: setGoal,
    addBook: addBook,
    deleteBook: deleteBook,
    login: login
});
